INSERT INTO `recommendations` VALUES (1,4,10,'AI_ANALYSIS','Focus on improving Assignment performance to achieve a higher final grade','{\"courseId\":10,\"userId\":4,\"recommendationType\":\"AI_ANALYSIS\",\"title\":\"AI Analysis for Course 1\",\"content\":\"{\\\"predictedFinalGrade\\\":{\\\"percentage\\\":\\\"90%\\\",\\\"gpa\\\":\\\"2.5\\\",\\\"confidence\\\":\\\"HIGH\\\",\\\"explanation\\\":\\\"Based on the student\'s current performance and potential for improvement, the predicted final grade is 90% with a corresponding GPA of 2.5.\\\"},\\\"assessmentGradeRecommendations\\\":{\\\"Assignments\\\":{\\\"recommendedScore\\\":\\\"95%\\\",\\\"reasoning\\\":\\\"The student\'s average score in Assignments is 85%, and with focused effort, they can achieve a score of 95%.\\\",\\\"priority\\\":\\\"MEDIUM\\\"},\\\"Quizzes\\\":{\\\"recommendedScore\\\":\\\"92%\\\",\\\"reasoning\\\":\\\"The student\'s average score in Quizzes is 88%, and with consistent practice, they can achieve a score of 92%.\\\",\\\"priority\\\":\\\"MEDIUM\\\"},\\\"Exam\\\":{\\\"recommendedScore\\\":\\\"90%\\\",\\\"reasoning\\\":\\\"The student\'s average score in Exam is 86%, and with thorough preparation, they can achieve a score of 90%.\\\",\\\"priority\\\":\\\"LOW\\\"}},\\\"targetGoalAnalysis\\\":{\\\"achievable\\\":true,\\\"analysis\\\":\\\"The target goal of achieving 100% in the course is achievable if the student maintains their current performance level and scores 95% or higher in the remaining Assignments, 92% or higher in the remaining Quizzes, and 90% or higher in the final Exam.\\\",\\\"factors\\\":[\\\"weighted grade calculations\\\",\\\"remaining assessment weights\\\",\\\"max achievable grade vs target\\\"],\\\"confidence\\\":\\\"HIGH\\\",\\\"explanation\\\":\\\"Based on the student\'s current weighted grade percentage and the remaining assessment weights, the target goal is achievable if they maintain their current performance level.\\\"},\\\"statusUpdate\\\":{\\\"currentStatus\\\":\\\"ON_T